// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "./ModelRegistry.sol";

/**
 * @title Marketplace
 * @dev Marketplace contract for buying/selling AI models
 * Handles payments, licensing, and revenue distribution
 */
contract Marketplace is Ownable, ReentrancyGuard, Pausable {

    // Reference to ModelRegistry contract
    ModelRegistry public modelRegistry;

    // Platform fee percentage (e.g., 250 = 2.5%)
    uint256 public platformFeePercent = 250;
    uint256 public constant FEE_DENOMINATOR = 10000;

    // Minimum price for paid models
    uint256 public minPrice = 0.001 ether;

    // License types
    enum LicenseType { PERSONAL, COMMERCIAL, ENTERPRISE }

    // Purchase record
    struct Purchase {
        uint256 modelId;
        address buyer;
        uint256 price;
        LicenseType licenseType;
        uint256 purchasedAt;
        bool isActive;
    }

    // Listing structure
    struct Listing {
        uint256 modelId;
        address seller;
        uint256 basePrice;
        uint256 commercialMultiplier;  // e.g., 300 = 3x for commercial
        uint256 enterpriseMultiplier;  // e.g., 1000 = 10x for enterprise
        bool isActive;
        uint256 totalSales;
        uint256 totalRevenue;
    }

    // Mappings
    mapping(uint256 => Listing) public listings;
    mapping(address => Purchase[]) public userPurchases;
    mapping(uint256 => mapping(address => bool)) public hasAccess;
    mapping(address => uint256) public sellerEarnings;
    mapping(address => uint256) public pendingWithdrawals;

    // Events
    event ModelListed(uint256 indexed modelId, address indexed seller, uint256 basePrice);
    event ModelDelisted(uint256 indexed modelId);
    event ModelPurchased(
        uint256 indexed modelId, 
        address indexed buyer, 
        uint256 price, 
        LicenseType licenseType
    );
    event EarningsWithdrawn(address indexed seller, uint256 amount);
    event PlatformFeeUpdated(uint256 newFee);
    event ListingUpdated(uint256 indexed modelId, uint256 newPrice);

    constructor(address _modelRegistry) Ownable(msg.sender) {
        modelRegistry = ModelRegistry(_modelRegistry);
    }

    /**
     * @dev List a model for sale
     */
    function listModel(
        uint256 modelId,
        uint256 basePrice,
        uint256 commercialMultiplier,
        uint256 enterpriseMultiplier
    ) external {
        require(modelRegistry.ownerOf(modelId) == msg.sender, "Not the model owner");
        require(basePrice >= minPrice || basePrice == 0, "Price below minimum");
        require(commercialMultiplier >= 100, "Commercial multiplier too low");
        require(enterpriseMultiplier >= commercialMultiplier, "Enterprise must be >= commercial");

        listings[modelId] = Listing({
            modelId: modelId,
            seller: msg.sender,
            basePrice: basePrice,
            commercialMultiplier: commercialMultiplier,
            enterpriseMultiplier: enterpriseMultiplier,
            isActive: true,
            totalSales: 0,
            totalRevenue: 0
        });

        emit ModelListed(modelId, msg.sender, basePrice);
    }

    /**
     * @dev Update listing price
     */
    function updateListing(
        uint256 modelId,
        uint256 newBasePrice,
        uint256 commercialMultiplier,
        uint256 enterpriseMultiplier
    ) external {
        Listing storage listing = listings[modelId];
        require(listing.seller == msg.sender, "Not the seller");
        require(listing.isActive, "Listing not active");

        listing.basePrice = newBasePrice;
        listing.commercialMultiplier = commercialMultiplier;
        listing.enterpriseMultiplier = enterpriseMultiplier;

        emit ListingUpdated(modelId, newBasePrice);
    }

    /**
     * @dev Delist a model
     */
    function delistModel(uint256 modelId) external {
        Listing storage listing = listings[modelId];
        require(listing.seller == msg.sender || owner() == msg.sender, "Not authorized");

        listing.isActive = false;
        emit ModelDelisted(modelId);
    }

    /**
     * @dev Calculate price based on license type
     */
    function calculatePrice(uint256 modelId, LicenseType licenseType) 
        public 
        view 
        returns (uint256) 
    {
        Listing memory listing = listings[modelId];
        require(listing.isActive, "Model not listed");

        if (licenseType == LicenseType.PERSONAL) {
            return listing.basePrice;
        } else if (licenseType == LicenseType.COMMERCIAL) {
            return (listing.basePrice * listing.commercialMultiplier) / 100;
        } else {
            return (listing.basePrice * listing.enterpriseMultiplier) / 100;
        }
    }

    /**
     * @dev Purchase a model
     */
    function purchaseModel(uint256 modelId, LicenseType licenseType) 
        external 
        payable 
        nonReentrant 
        whenNotPaused 
    {
        Listing storage listing = listings[modelId];
        require(listing.isActive, "Model not listed");
        require(!hasAccess[modelId][msg.sender], "Already purchased");

        uint256 price = calculatePrice(modelId, licenseType);
        require(msg.value >= price, "Insufficient payment");

        // Calculate fees
        uint256 platformFee = (price * platformFeePercent) / FEE_DENOMINATOR;
        uint256 sellerAmount = price - platformFee;

        // Update state
        hasAccess[modelId][msg.sender] = true;
        listing.totalSales++;
        listing.totalRevenue += price;

        // Record purchase
        userPurchases[msg.sender].push(Purchase({
            modelId: modelId,
            buyer: msg.sender,
            price: price,
            licenseType: licenseType,
            purchasedAt: block.timestamp,
            isActive: true
        }));

        // Credit seller
        pendingWithdrawals[listing.seller] += sellerAmount;
        sellerEarnings[listing.seller] += sellerAmount;

        // Record download in registry
        modelRegistry.recordDownload(modelId);

        // Refund excess payment
        if (msg.value > price) {
            payable(msg.sender).transfer(msg.value - price);
        }

        emit ModelPurchased(modelId, msg.sender, price, licenseType);
    }

    /**
     * @dev Withdraw pending earnings
     */
    function withdrawEarnings() external nonReentrant {
        uint256 amount = pendingWithdrawals[msg.sender];
        require(amount > 0, "No earnings to withdraw");

        pendingWithdrawals[msg.sender] = 0;
        payable(msg.sender).transfer(amount);

        emit EarningsWithdrawn(msg.sender, amount);
    }

    /**
     * @dev Check if user has access to a model
     */
    function checkAccess(uint256 modelId, address user) external view returns (bool) {
        // Owner always has access
        if (modelRegistry.ownerOf(modelId) == user) return true;
        // Check if purchased
        return hasAccess[modelId][user];
    }

    /**
     * @dev Get user's purchases
     */
    function getUserPurchases(address user) external view returns (Purchase[] memory) {
        return userPurchases[user];
    }

    /**
     * @dev Get listing details
     */
    function getListing(uint256 modelId) external view returns (Listing memory) {
        return listings[modelId];
    }

    // Admin functions
    function setPlatformFee(uint256 newFee) external onlyOwner {
        require(newFee <= 1000, "Fee too high"); // Max 10%
        platformFeePercent = newFee;
        emit PlatformFeeUpdated(newFee);
    }

    function setMinPrice(uint256 newMinPrice) external onlyOwner {
        minPrice = newMinPrice;
    }

    function withdrawPlatformFees() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No balance");
        payable(owner()).transfer(balance);
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}

contracts/ModelRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title ModelRegistry
 * @dev NFT-based registry for AI models on ModelChain
 * Each model is represented as an ERC721 token with metadata stored on IPFS
 */
contract ModelRegistry is ERC721, ERC721URIStorage, Ownable {
    uint256 private _tokenIdCounter;

    // Model categories
    enum Category { TEXT, IMAGE, AUDIO, VIDEO, MULTIMODAL, OTHER }

    // Model status
    enum Status { PENDING, VALIDATED, REJECTED, SUSPENDED }

    // Model structure
    struct Model {
        uint256 id;
        address owner;
        string name;
        string ipfsHash;        // IPFS hash for model files
        string metadataHash;    // IPFS hash for metadata JSON
        Category category;
        Status status;
        uint256 price;          // Price in wei
        uint256 createdAt;
        uint256 updatedAt;
        uint256 totalDownloads;
        uint256 totalRatings;
        uint256 ratingSum;
    }

    // Mappings
    mapping(uint256 => Model) public models;
    mapping(address => uint256[]) public ownerModels;
    mapping(string => bool) public ipfsHashUsed;

    // Events
    event ModelRegistered(
        uint256 indexed tokenId,
        address indexed owner,
        string name,
        string ipfsHash,
        Category category,
        uint256 price
    );
    event ModelUpdated(uint256 indexed tokenId, string metadataHash, uint256 price);
    event ModelStatusChanged(uint256 indexed tokenId, Status status);
    event ModelPurchased(uint256 indexed tokenId, address indexed buyer, uint256 price);
    event ModelRated(uint256 indexed tokenId, address indexed rater, uint8 rating);
    event ModelDownloaded(uint256 indexed tokenId, address indexed downloader);

    // Modifiers
    modifier onlyModelOwner(uint256 tokenId) {
        require(ownerOf(tokenId) == msg.sender, "Not the model owner");
        _;
    }

    modifier modelExists(uint256 tokenId) {
        require(_exists(tokenId), "Model does not exist");
        _;
    }

    constructor() ERC721("ModelChain AI Model", "MCAI") Ownable(msg.sender) {}

    /**
     * @dev Register a new AI model
     * @param name Model name
     * @param ipfsHash IPFS hash where model files are stored
     * @param metadataHash IPFS hash for metadata JSON
     * @param category Model category
     * @param price Price in wei (0 for free models)
     */
    function registerModel(
        string memory name,
        string memory ipfsHash,
        string memory metadataHash,
        Category category,
        uint256 price
    ) external returns (uint256) {
        require(bytes(name).length > 0, "Name cannot be empty");
        require(bytes(ipfsHash).length > 0, "IPFS hash cannot be empty");
        require(!ipfsHashUsed[ipfsHash], "Model already registered");

        uint256 tokenId = _tokenIdCounter;
        _tokenIdCounter++;

        _safeMint(msg.sender, tokenId);
        _setTokenURI(tokenId, metadataHash);

        models[tokenId] = Model({
            id: tokenId,
            owner: msg.sender,
            name: name,
            ipfsHash: ipfsHash,
            metadataHash: metadataHash,
            category: category,
            status: Status.PENDING,
            price: price,
            createdAt: block.timestamp,
            updatedAt: block.timestamp,
            totalDownloads: 0,
            totalRatings: 0,
            ratingSum: 0
        });

        ownerModels[msg.sender].push(tokenId);
        ipfsHashUsed[ipfsHash] = true;

        emit ModelRegistered(tokenId, msg.sender, name, ipfsHash, category, price);
        return tokenId;
    }

    /**
     * @dev Update model metadata and price
     */
    function updateModel(
        uint256 tokenId,
        string memory metadataHash,
        uint256 price
    ) external modelExists(tokenId) onlyModelOwner(tokenId) {
        Model storage model = models[tokenId];
        model.metadataHash = metadataHash;
        model.price = price;
        model.updatedAt = block.timestamp;

        _setTokenURI(tokenId, metadataHash);

        emit ModelUpdated(tokenId, metadataHash, price);
    }

    /**
     * @dev Update model status (only owner/validators)
     */
    function setModelStatus(uint256 tokenId, Status status) 
        external 
        modelExists(tokenId) 
        onlyOwner 
    {
        models[tokenId].status = status;
        models[tokenId].updatedAt = block.timestamp;
        emit ModelStatusChanged(tokenId, status);
    }

    /**
     * @dev Record a model download
     */
    function recordDownload(uint256 tokenId) 
        external 
        modelExists(tokenId) 
    {
        models[tokenId].totalDownloads++;
        emit ModelDownloaded(tokenId, msg.sender);
    }

    /**
     * @dev Rate a model (1-5 stars)
     */
    function rateModel(uint256 tokenId, uint8 rating) 
        external 
        modelExists(tokenId) 
    {
        require(rating >= 1 && rating <= 5, "Rating must be 1-5");

        Model storage model = models[tokenId];
        model.totalRatings++;
        model.ratingSum += rating;

        emit ModelRated(tokenId, msg.sender, rating);
    }

    // View functions
    function getModel(uint256 tokenId) external view returns (Model memory) {
        require(_exists(tokenId), "Model does not exist");
        return models[tokenId];
    }

    function getOwnerModels(address owner) external view returns (uint256[] memory) {
        return ownerModels[owner];
    }

    function getTotalModels() external view returns (uint256) {
        return _tokenIdCounter;
    }

    function getAverageRating(uint256 tokenId) external view returns (uint256) {
        Model memory model = models[tokenId];
        if (model.totalRatings == 0) return 0;
        return (model.ratingSum * 100) / model.totalRatings; // Returns rating * 100 for precision
    }

    // Required overrides
    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function _exists(uint256 tokenId) internal view returns (bool) {
        return _ownerOf(tokenId) != address(0);
    }
}

contracts/UserRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title UserRegistry
 * @dev Decentralized user profile registry for ModelChain
 * User data is stored on IPFS, only the hash is stored on-chain
 */
contract UserRegistry is Ownable, ReentrancyGuard {

    // User roles
    enum UserRole { Buyer, Developer, Validator }

    // User profile structure (minimal on-chain data)
    struct User {
        string ipfsHash;           // IPFS hash containing full profile data
        UserRole primaryRole;      // Primary role: Buyer, Developer, or Validator
        bool isDeveloper;          // Can upload and sell models
        bool isValidator;          // Can validate models
        uint256 registeredAt;      // Registration timestamp
        uint256 reputation;        // Reputation score (0-1000)
        uint256 totalTransactions; // Total completed transactions
        bool isActive;             // Account active status
    }

    // Validator-specific data
    struct ValidatorInfo {
        uint256 stakedAmount;      // Amount staked for validation rights
        uint256 validationsCount;  // Number of validations performed
        uint256 successfulValidations; // Successful validations
        bool isApproved;           // Admin approved validator
    }

    // Developer-specific data
    struct DeveloperInfo {
        uint256 modelsUploaded;    // Number of models uploaded
        uint256 totalSales;        // Total sales amount
        uint256 totalRatings;      // Sum of all ratings received
        uint256 ratingsCount;      // Number of ratings received
    }

    // State variables
    mapping(address => User) public users;
    mapping(address => ValidatorInfo) public validators;
    mapping(address => DeveloperInfo) public developers;

    // Lists for enumeration
    address[] public userList;
    address[] public validatorList;
    address[] public developerList;

    // Minimum stake required to become a validator (in wei)
    uint256 public validatorMinStake = 0.1 ether;

    // Events
    event UserRegistered(address indexed user, UserRole role, string ipfsHash, uint256 timestamp);
    event ProfileUpdated(address indexed user, string newIpfsHash, uint256 timestamp);
    event RoleUpgraded(address indexed user, UserRole newRole, uint256 timestamp);
    event ValidatorStaked(address indexed validator, uint256 amount, uint256 timestamp);
    event ValidatorUnstaked(address indexed validator, uint256 amount, uint256 timestamp);
    event ValidatorApproved(address indexed validator, uint256 timestamp);
    event ReputationUpdated(address indexed user, uint256 newReputation, uint256 timestamp);
    event DeveloperStatsUpdated(address indexed developer, uint256 modelsUploaded, uint256 totalSales);

    constructor() Ownable(msg.sender) {}

    // Modifiers
    modifier onlyRegistered() {
        require(users[msg.sender].isActive, "User not registered");
        _;
    }

    modifier onlyValidator() {
        require(users[msg.sender].isValidator, "Not a validator");
        require(validators[msg.sender].isApproved, "Validator not approved");
        _;
    }

    modifier onlyDeveloper() {
        require(users[msg.sender].isDeveloper, "Not a developer");
        _;
    }

    /**
     * @dev Register a new user
     * @param _ipfsHash IPFS hash containing full profile data
     * @param _role Primary role selection
     */
    function registerUser(string memory _ipfsHash, UserRole _role) external nonReentrant {
        require(!users[msg.sender].isActive, "User already registered");
        require(bytes(_ipfsHash).length > 0, "IPFS hash required");

        bool isDev = (_role == UserRole.Developer);
        bool isVal = (_role == UserRole.Validator);

        users[msg.sender] = User({
            ipfsHash: _ipfsHash,
            primaryRole: _role,
            isDeveloper: isDev,
            isValidator: isVal,
            registeredAt: block.timestamp,
            reputation: 500, // Start with neutral reputation
            totalTransactions: 0,
            isActive: true
        });

        userList.push(msg.sender);

        if (isDev) {
            developers[msg.sender] = DeveloperInfo({
                modelsUploaded: 0,
                totalSales: 0,
                totalRatings: 0,
                ratingsCount: 0
            });
            developerList.push(msg.sender);
        }

        if (isVal) {
            validators[msg.sender] = ValidatorInfo({
                stakedAmount: 0,
                validationsCount: 0,
                successfulValidations: 0,
                isApproved: false
            });
            validatorList.push(msg.sender);
        }

        emit UserRegistered(msg.sender, _role, _ipfsHash, block.timestamp);
    }

    /**
     * @dev Update user profile IPFS hash
     * @param _newIpfsHash New IPFS hash
     */
    function updateProfile(string memory _newIpfsHash) external onlyRegistered {
        require(bytes(_newIpfsHash).length > 0, "IPFS hash required");
        users[msg.sender].ipfsHash = _newIpfsHash;
        emit ProfileUpdated(msg.sender, _newIpfsHash, block.timestamp);
    }

    /**
     * @dev Upgrade to developer role
     * @param _newIpfsHash Updated profile IPFS hash
     */
    function upgradeToDeveloper(string memory _newIpfsHash) external onlyRegistered {
        require(!users[msg.sender].isDeveloper, "Already a developer");

        users[msg.sender].isDeveloper = true;
        users[msg.sender].ipfsHash = _newIpfsHash;

        developers[msg.sender] = DeveloperInfo({
            modelsUploaded: 0,
            totalSales: 0,
            totalRatings: 0,
            ratingsCount: 0
        });
        developerList.push(msg.sender);

        emit RoleUpgraded(msg.sender, UserRole.Developer, block.timestamp);
    }

    /**
     * @dev Stake to become a validator
     */
    function stakeAsValidator() external payable onlyRegistered nonReentrant {
        require(msg.value >= validatorMinStake, "Insufficient stake amount");

        if (!users[msg.sender].isValidator) {
            users[msg.sender].isValidator = true;
            validators[msg.sender] = ValidatorInfo({
                stakedAmount: msg.value,
                validationsCount: 0,
                successfulValidations: 0,
                isApproved: false
            });
            validatorList.push(msg.sender);
        } else {
            validators[msg.sender].stakedAmount += msg.value;
        }

        emit ValidatorStaked(msg.sender, msg.value, block.timestamp);
    }

    /**
     * @dev Unstake validator funds (only if not actively validating)
     * @param _amount Amount to unstake
     */
    function unstakeValidator(uint256 _amount) external onlyRegistered nonReentrant {
        require(users[msg.sender].isValidator, "Not a validator");
        require(validators[msg.sender].stakedAmount >= _amount, "Insufficient staked balance");

        validators[msg.sender].stakedAmount -= _amount;

        // If stake falls below minimum, deactivate validator status
        if (validators[msg.sender].stakedAmount < validatorMinStake) {
            validators[msg.sender].isApproved = false;
        }

        (bool success, ) = payable(msg.sender).call{value: _amount}("");
        require(success, "Transfer failed");

        emit ValidatorUnstaked(msg.sender, _amount, block.timestamp);
    }

    /**
     * @dev Approve a validator (admin only)
     * @param _validator Validator address
     */
    function approveValidator(address _validator) external onlyOwner {
        require(users[_validator].isValidator, "Not a validator");
        require(validators[_validator].stakedAmount >= validatorMinStake, "Insufficient stake");

        validators[_validator].isApproved = true;
        emit ValidatorApproved(_validator, block.timestamp);
    }

    /**
     * @dev Update user reputation (called by other contracts)
     * @param _user User address
     * @param _newReputation New reputation score
     */
    function updateReputation(address _user, uint256 _newReputation) external onlyOwner {
        require(users[_user].isActive, "User not registered");
        require(_newReputation <= 1000, "Reputation max is 1000");

        users[_user].reputation = _newReputation;
        emit ReputationUpdated(_user, _newReputation, block.timestamp);
    }

    /**
     * @dev Increment transaction count
     * @param _user User address
     */
    function incrementTransactions(address _user) external onlyOwner {
        require(users[_user].isActive, "User not registered");
        users[_user].totalTransactions++;
    }

    /**
     * @dev Update developer stats (called by Marketplace contract)
     * @param _developer Developer address
     * @param _saleAmount Sale amount to add
     * @param _rating Rating received (0-5)
     */
    function updateDeveloperStats(
        address _developer, 
        uint256 _saleAmount, 
        uint256 _rating
    ) external onlyOwner {
        require(users[_developer].isDeveloper, "Not a developer");

        developers[_developer].totalSales += _saleAmount;
        if (_rating > 0 && _rating <= 5) {
            developers[_developer].totalRatings += _rating;
            developers[_developer].ratingsCount++;
        }

        emit DeveloperStatsUpdated(
            _developer, 
            developers[_developer].modelsUploaded, 
            developers[_developer].totalSales
        );
    }

    /**
     * @dev Increment models uploaded count
     * @param _developer Developer address
     */
    function incrementModelsUploaded(address _developer) external onlyOwner {
        require(users[_developer].isDeveloper, "Not a developer");
        developers[_developer].modelsUploaded++;
    }

    /**
     * @dev Record a validation
     * @param _validator Validator address
     * @param _successful Whether validation was successful
     */
    function recordValidation(address _validator, bool _successful) external onlyOwner {
        require(users[_validator].isValidator, "Not a validator");

        validators[_validator].validationsCount++;
        if (_successful) {
            validators[_validator].successfulValidations++;
        }
    }

    /**
     * @dev Set minimum validator stake
     * @param _minStake New minimum stake
     */
    function setValidatorMinStake(uint256 _minStake) external onlyOwner {
        validatorMinStake = _minStake;
    }

    // View functions

    /**
     * @dev Check if user is registered
     */
    function isUserRegistered(address _user) external view returns (bool) {
        return users[_user].isActive;
    }

    /**
     * @dev Get user's full profile
     */
    function getUserProfile(address _user) external view returns (
        string memory ipfsHash,
        UserRole primaryRole,
        bool isDeveloper,
        bool isValidator,
        uint256 registeredAt,
        uint256 reputation,
        uint256 totalTransactions,
        bool isActive
    ) {
        User memory user = users[_user];
        return (
            user.ipfsHash,
            user.primaryRole,
            user.isDeveloper,
            user.isValidator,
            user.registeredAt,
            user.reputation,
            user.totalTransactions,
            user.isActive
        );
    }

    /**
     * @dev Get developer info
     */
    function getDeveloperInfo(address _developer) external view returns (
        uint256 modelsUploaded,
        uint256 totalSales,
        uint256 averageRating
    ) {
        DeveloperInfo memory dev = developers[_developer];
        uint256 avgRating = dev.ratingsCount > 0 
            ? (dev.totalRatings * 100) / dev.ratingsCount 
            : 0;
        return (dev.modelsUploaded, dev.totalSales, avgRating);
    }

    /**
     * @dev Get validator info
     */
    function getValidatorInfo(address _validator) external view returns (
        uint256 stakedAmount,
        uint256 validationsCount,
        uint256 successfulValidations,
        bool isApproved
    ) {
        ValidatorInfo memory val = validators[_validator];
        return (val.stakedAmount, val.validationsCount, val.successfulValidations, val.isApproved);
    }

    /**
     * @dev Get total user count
     */
    function getTotalUsers() external view returns (uint256) {
        return userList.length;
    }

    /**
     * @dev Get total validator count
     */
    function getTotalValidators() external view returns (uint256) {
        return validatorList.length;
    }

    /**
     * @dev Get total developer count
     */
    function getTotalDevelopers() external view returns (uint256) {
        return developerList.length;
    }
}

